import React,{useEffect} from 'react'
import Axios from 'axios'


const DisplayTeachers = (props) => {
    let name= props.str;
    let names= [];

    useEffect(()=>{
        handleClick(names);
        console.log("inside useeffect");
    },[names]);
    
    Axios.get("http://localhost:3001/search",{params: { name : name}}).then((response)=>{
        names.push(response.data); 
    });
    let dbdata = [];
    const handleClick = (names) => {
        console.log(names);
        for(let i=0;i<names.length;i++){
            console.log(names[i][0].name);
            Axios.get("http://localhost:3001/profile",{params: { name : names[i][0].name}}).then((response)=>{
                dbdata.push(response.data);
            });
            console.log(dbdata);
        }
    }

    return (
        <div>
            <h1>{name}</h1>
            {
                dbdata.map((i)=>{
                    console.log(i.date,i.starttime);
                    return(
                        <div>
                            <div>
                                {name},{i.date},{i.starttime},{i.endtime},{i.task}
                            </div>
                            <button>
                                Add
                            </button>
                        </div>
                    )
                })
            }
            {/* <button onClick={() => {
                handleClick(names)}
            }>Click here</button> */}
        </div>
    )
}

export default DisplayTeachers
